import React,{Component} from 'react';
import './Home.scss'
class Home extends Component{
    render(){
        return(
            <div id="homePage">
                <div className="title">
                    <p className="name">محمد خزائی</p>
                    <p className="job">Front-End Developer</p>
                </div>
            </div>
        )
    }
}
export default Home
